  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Seney
  NWR, Huron Islands and Harbor Island NWR outlines Refuge accomplishments during
  the 1986 calendar year. The report begins with Refuge highlights and information
  about climatic and habitat conditions, planning, and administration. Habitat management
  is discussed; topics include forests, croplands, fire management, pest control,
  and wilderness and special areas. The wildlife section of the report discusses endangered
  and threatened species, migratory birds, mammals, non-migratory birds, wildlife
  propagation and stocking, surplus animal disposal, animal control, marking and banding,
  and disease prevention and control. Interpretation and recreation activities are
  outlined; topics include information and interpretation, recreation, and law enforcement.
  The equipment and facilities section describes rehabilitation and energy conservation.
  Cooperative programs are discussed. Photographs are attached.\",\n\t\"owner_org\":
